        <>
            <Card classes={classes.cardLogin}>
                <CardHeader>
                    <h4 className="head-login">Masuk ke {process.env.APP_NAME}</h4>
                </CardHeader>
                <CardContent>

                </CardContent>
            </Card>
            <style jsx>{`
                .head-login {
                    font-family: Poppins;
                    font-size: 16px;
                    font-color: ${colors.blackPrimary};
                    text-align: center;
                }

            `}</style>
        </>
    )
}
const mapStateToProps = (state) => ({
    auth : state.auth
})

export default connect(mapStateToProps)(Login)
